import React from 'react';
import TextField from '@mui/material/TextField';
import { styled } from '@mui/material/styles';

const WhiteOutlinedInput = styled('input')({
  color: 'white',
  borderColor: 'white',
});

const MyTextBox = () => {
  return (
    <TextField
      fullWidth
      label="Enter Text"
      variant="outlined"
      InputProps={{
        inputComponent: WhiteOutlinedInput,
      }}
    />
  );
};

export default MyTextBox;
